Somatic characters. Maximum body length: male 21 mm; female 14 mm (
Borutzky 1957
). Body color dark grey-brown white or yellow spots at base of coxal plates of pereonites 2-7(Figure 1B). Dorsal surface of tergites smooth. Posterior edges of coxal plates of pereonites straight (Figure 6B). Distal part of head covered with scattered sharp triangular dorsal scale-setae (Figure 6A). Noduli laterales on pereonites 3-4 located distinctly more distant from coxal plates lateral edges (Figure 6B). Body relatively elongated; pleon outline not continuous with pereon (Figure 1B). Cephalic lobes well developed; median lobe rounded (Figure 6C). Telson with distal part elongated and distal corner forming sharp triangle (Figure 6D).

